Add the wheels library to the FirstWheelsApp project, so that Eclipse can use it when you write code in that project In the Package Explorer view in Eclipse, right click on the FirstWheelsApp project and select "Build Path" -> "Add External Archives". Then navigate to the wheels.zip file that you downloaded from Blackboard, select it, and click "Open". (Depending on your version of Eclipse, you may get slightly different views after you select "Build Path" -> "Add External Archives" in the previous step. If that is the case, select "Add External Jars" and then navigate to the wheels.zip file). Create a new Java class in the FirstWheelsApp project. Right click on the FirstWheelsApp project in the Package Explorer view and select "New" -> "Class". Call this class FirstApp. Edit the FirstApp class. Double-click on the FirstApp class in the PackageExplorer view to open the Java editor (it might already open by default as soon as you create the class). Replace the code in the FirstApp class with the following code. public class FirstApp extends wheels.users.Frame
{ // instance variable declaration private wheels.users.Ellipse _ellipse; // constructor definition public FirstApp() { // create an instance of an Ellipse _ellipse = new wheels.users.Ellipse(); } // This is the main method, which specifies the code that // will be first executed when the FirstApp program is run. public static void main(String[] argv) { FirstApp myApp = new FirstApp(); }
} Run the FirstApp Right click on the FirstApp class and select "Run As" -> "Java Application". A new window containing an ellipse (in this case a circle) should pop up. Congrats! You have successfully run your first Java graphics application using the wheels library.

